INSERT [dbo].[tbl_Translation] ([ID], [LanguageID], [Type], [Key], [Value]) VALUES (119051, 80, N'translation.footer', N'advisory', N'Digital currencies are not currently backed nor supported by any government or central bank. The value of digital currencies is determined by economy of supply and demand, and they are more volatile than traditional currencies. Trading in digital currencies comes with significant risks, including volatile market price swings or flash crashes, market manipulation, and cybersecurity risks. In addition, digital currency markets and exchanges are not regulated with the same controls or customer protections available in equity, option, futures, or foreign exchange investing. Digital currency trading requires knowledge of digital currency markets. In attempting to profit through digital currency trading, you must compete with traders worldwide. You should have appropriate knowledge and experience before engaging in substantial digital currency trading. Digital currency trading may not generally be appropriate, particularly with funds drawn from retirement savings, student loans, mortgages, emergency funds, or funds set aside for other purposes. Digital currency trading can lead to large and immediate financial losses. Under certain market conditions, you may find it difficult or impossible to liquidate a position quickly at a reasonable price. This can occur, for example, when the market for a particular digital currency suddenly drops, or if trading is halted due to recent news events, unusual trading activity, or changes in the underlying digital currency system. Several federal agencies have also published advisory documents surrounding the risks of virtual currency. For more information see the <1>CFPB’s Consumer Advisory</1>, the <3>CFTC’s Customer Advisory</3>, the <5>SEC’s Investor Alert</5>, and <7>FINRA’s Investor Alert</7>.')
