INSERT [dbo].[tbl_Translation] ([ID], [LanguageID], [Type], [Key], [Value]) VALUES (120661, 81, N'translation.footer', N'legal', N'{{exchangeName}} 不提出任何投資建議。在本網站上列出數字貨幣或任何其他通信，無論是通過本網站還是以任何其他方式進行，都不應被解釋為購買或出售任何證券的建議。')
INSERT [dbo].[tbl_Translation] ([ID], [LanguageID], [Type], [Key], [Value]) VALUES (120662, 81, N'translation.footer', N'advisory', N'數字貨幣目前沒有得到任何政府或中央銀行的支援或支援。數位貨幣的價值是由供求經濟決定的，它們比傳統貨幣更具波動性。數字貨幣交易伴隨著重大風險，包括市場價格波動或閃崩、市場操縱和網路安全風險。此外，數位貨幣市場和交易所不受與股票、期權、期貨或外匯投資相同的控制或客戶保護的監管。數字貨幣交易需要瞭解數位貨幣市場。在試圖通過數字貨幣交易獲利時，您必須與全球交易者競爭。在進行大量數字貨幣交易之前，您應該具備適當的知識和經驗。數字貨幣交易通常可能不合適，特別是從退休儲蓄、學生貸款、抵押貸款、應急基金或為其他目的預留的資金中提取資金。數字貨幣交易可能導致巨大而直接的財務損失。在某些市場條件下，您可能會發現很難或不可能以合理的價格快速清算頭寸。例如，當特定數位貨幣的市場突然下跌時，或者由於最近的新聞事件、異常交易活動或底層數位貨幣系統的變化而停止交易時，就會發生這種情況。一些聯邦機構也發佈了有關虛擬貨幣風險的諮詢檔。有關更多資訊，請參閱 <1>CFPB 的消費者公告</1>、<3>CFTC 的客戶公告</3>、<5>SEC 的投資者警報</5> 和 <7>FINRA 的投資者警報</7>。')
