27741.145,27831.424,27825.402,27682.85,27671.393,27472.775,27578.594,27610.69,27652.57,27670.2,27760.36,27773.705,27796.918,27706.42,27677.15,27738.375,27679.771,27668.314,27848.08,27835.904,27851.164,27847.031,27944.877,28245.977,27844.09,27899.309,27853.559,27880.643,27864.959,27894.889,27796.402,27876.285,28150.062]', N'21000000', N'0.0538079', N'-0.9321884', N'20.5064', CAST(N'2009-01-03T00:00:00.000' AS DateTime), CAST(N'2023-03-27T03:39:34.667' AS DateTime), N'Cryptocurrency', N'Bitcoin is the first successful internet money based on peer-to-peer technology; whereby no central bank or authority is involved in the transaction and production of the Bitcoin currency. It was created by an anonymous individual/group under the name, Satoshi Nakamoto. The source code is available publicly as an open source project, anybody can look at it and be part of the developmental process.

Bitcoin is changing the way we see money as we speak. The idea was to produce a means of exchange, independent of any central authority, that could be transferred electronically in a secure, verifiable and immutable way. It is a decentralized peer-to-peer internet currency making mobile payment easy, very low transaction fees, protects your identity, and it works anywhere all the time with no central authority and banks.

Bitcoin is designed to have only 21 million BTC ever created, thus making it a deflationary currency. Bitcoin uses the <a href="https://www.coingecko.com/enhashing_algorithm=SHA-256">SHA-256</a> hashing algorithm with an average transaction confirmation time of 10 minutes. Miners today are mining Bitcoin using ASIC chip dedicated to only mining Bitcoin, and the hash rate has shot up to peta hashes.

Being the first successful online cryptography currency, Bitcoin has inspired other alternative currencies such as <a href="https://www.coingecko.com/en/coins/litecoin">Litecoin</a>, <a href="https://www.coingecko.com/en/coins/peercoin">Peercoin</a>, <a href="https://www.coingecko.com/en/coins/primecoin">Primecoin</a>, and so on.

The cryptocurrency then took off with the innovation of the turing-complete smart contract by <a href="https://www.coingecko.com/en/coins/ethereum">Ethereum</a> which led to the development of other amazing projects such as <a href="https://www.coingecko.com/en/coins/eos">EOS</a>, <a href="https://www.coingecko.com/en/coins/tron">Tron</a>, and even crypto-collectibles such as <a href="https://www.coingecko.com/buzz/ethereum-still-king-dapps-cryptokitties-need-1-billion-on-eos">CryptoKitties</a>.', N'http://www.bitcoin.org', N'https://www.reddit.com/r/Bitcoin/', N'https://bitcointalk.org/', N'https://blockchair.com/bitcoin/', N'{"github":["https://github.com/bitcoin/bitcoin","https://github.com/bitcoin/bips"],"bitbucket":[]}', NULL, CAST(N'2023-03-27T23:42:25.590' AS DateTime))
