On Ethereum, all transactions and smart contract executions require a small fee to be paid. This fee is called Gas. In technical terms, Gas refers to the unit of measure on the amount of computational effort required to execute an operation or a smart contract. The more complex the execution operation is, the more gas is required to fulfill that operation. Gas fees are paid entirely in Ether (ETH), which is the native coin of the blockchain. The price of gas can fluctuate from time to time depending on the network demand.', N'https://www.ethereum.org/', N'https://www.reddit.com/r/ethereum', N'', N'https://etherscan.io/', N'{"github":["https://github.com/ethereum/go-ethereum","https://github.com/ethereum/py-evm","https://github.com/ethereum/aleth","https://github.com/ethereum/web3.py","https://github.com/ethereum/solidity","https://github.com/ethereum/sharding","https://github.com/ethereum/casper","https://github.com/paritytech/parity"],"bitbucket":[]}', NULL, CAST(N'2023-03-27T23:42:25.600' AS DateTime))
